import React from 'react';

function Feed(){
	return(
		<div className='feed' style={{marginTop: 20}}>
			<Post />
		</div>
	);
}

class Post extends React.Component{
	constructor(props){
		super(props);

		this.testData = ['data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,'];
		this.selectedIndex = 0;
	}

	render(){
		return(
			<div className='post'>
				<img className='profile-photo' src='data:image/png;base64,'/>
				<h1>Sarah Steel</h1>
				<h5>Geometry, English, Philosophy</h5>
				<p>
					Lorem ipsum dolor sit amet, 
					consectetur adipisicing elit.
					Sed aliquam tempora recusandae
					blanditiis facilis vitae! Soluta, 
					odit neque iure, perspiciatis deserunt animi libero, 
					veniam consequatur et ab ipsam hic consequuntur!
				</p>

				<ImageGallary images={this.testData} selectedIndex={this.selectedIndex} />

				<p><span className='textarea' role='textbox' contenteditable='true'></span></p>
				<button><i class="fas fa-camera-retro"></i></button>
				<button className='submit-comment'>Submit</button>
			</div>
		);
	}
}

function ImageGallary(props){
	const smallImages = props.images.map((image, index) =>
		<img className='small-image' src={image}/>
	);

	return(
		<div className='image-gal'>
			<img className='large-image' src={props.images[props.selectedIndex]} />
			{smallImages}
		</div>
	);
}

export default Feed;
